import React from "react";

const OtherProjects: React.FC = () => {
  return (
    <section className="px-8 py-16">
      <h2 className="text-xl font-bold mb-6">Other Projects</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <div className="border p-4">Project A</div>
        <div className="border p-4">Project B</div>
        <div className="border p-4">Project C</div>
      </div>
    </section>
  );
};

export default OtherProjects;
